import Vue from 'vue'
import App from '@/App.vue'
import router from '@/router'

// Create the app instance
const app = Vue({
  router,
    store,
    render: (h) => h(App)
}
)

// Add tue router instance
// app.use(router)

// Then mount the app instance
app.mount('#app')
